# Ibragimovo, Chishminsky District, Republic of Bashkortostan

}}
Ibragimovo (; , Ä°brahim) is a rural locality (a selo) and the administrative centre of Ibragimovsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The population was 344 as of 2010. There are 6 streets.
Geography
Ibragimovo is located 32&nbsp;km southeast of Chishmy, the district's administrative seat. Bikeyevo is the nearest rural locality.
